import React from 'react';
import logo from './logo.svg';
//import './App.css';
import BootstrapCard from './component/BootstrapCard';
import card1 from './images/active-adult-athlete-body-416778.jpg';
import card2 from './images/active-adult-biceps-body-416809.jpg';
import card3 from './images/grayscale-photo-of-man-sitting-on-bench-1431283.jpg';
import card4 from './images/active-adult-athlete-body-416778.jpg';

function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-dark bg-dark">
        <a href="/" className="navbar-brand">React Bootstrap</a>
      </nav>
      <div className="container mt-3">
        <div className = "row">
          <div className = "col-md-4">
          <BootstrapCard image={card1}></BootstrapCard>
          <BootstrapCard image={card2}></BootstrapCard>
          <BootstrapCard image={card3}></BootstrapCard>
          <BootstrapCard image={card4}></BootstrapCard>
          </div>
        </div>
      </div>

    </div>
  );
}

export default App;
